sys_variable_value.value:
(function execute(inputs, outputs) {

  var Today = new GlideDate();

  if(inputs.t_date) {
    var TestValidityDate = new GlideDateTime(inputs.t_date);
    TestValidityDate.addDaysUTC(5);
    outputs.testvaliditydate = TestValidityDate.getDate();
  }
  else outputs.testvaliditydate = '';

  if( inputs.v_date ) {
    var PartialVaccineValidityDate = new GlideDateTime(inputs.v_date);
    PartialVaccineValidityDate.addDaysUTC(45);
    outputs.partialvaccinevaliditydate = PartialVaccineValidityDate.getDate();

    var CompleteVaccineValidityDate = new GlideDateTime(inputs.v_date);
    CompleteVaccineValidityDate.addDaysUTC(270);
    outputs.copmpletevaccinevaliditydate = CompleteVaccineValidityDate.getDate();
  }
  else {
      outputs.copmpletevaccinevaliditydate = '';
      outputs.partialvaccinevaliditydate = '';
  }

  outputs.today = Today;

})(inputs, outputs);

